Okay, let's break down the responder behavior in this ultimatum game-like setting and build a computational model.

**1. Psychological Mechanisms:**

*   **Fairness/Equity:** Responders are sensitive to the fairness of the offer. This isn't just about absolute amounts, but also relative to their contribution. We need to capture how responders assess the fairness of the split.
*   **Loss Aversion:** People tend to feel the pain of a loss more strongly than the pleasure of an equivalent gain. In this context, responders might be averse to receiving less than what they perceive as their "fair share."
*   **Social Preferences (Inequity Aversion):** This is related to fairness but specifically captures the idea that people dislike unequal outcomes, whether the inequality benefits them or hurts them.
*   **Monetary Value/Utility:** At the very least, receiving more money is going to be preferrable to receiving less. It's likely there is diminishing utility to gains in monetary value.
*   **Noise/Stochasticity:** Human behavior isn't perfectly rational. There will always be some degree of randomness in decision-making.

**2. Interaction of Mechanisms:**

Fairness perceptions form a baseline. If the offer is perceived as sufficiently fair, loss aversion and inequity aversion might not come into play as strongly. However, if the offer is unfair, these mechanisms could amplify the rejection likelihood. Monetary utility serves as the counteracting force, as people may be willing to accept unfair offers to still gain something. The level of noise will influence the consistency of a participant's responses.

**3. Mathematical Form:**

I'll use a utility-based model that incorporates these factors. The utility of accepting an offer will be a combination of:

*   The value of the offer to self, which will be relative to the total monetary value
*   Fairness considerations, influenced by the relative contribution of the responder and proposer.
*   A parameter that moderates the importance of fairness relative to monetary value.

The model will have the following form:

```
Utility = value_self - (alpha * unfairness_term)
```

Where the unfairness term captures the difference between the offer and the perceived fair split.

**4. Parameters:**

*   `alpha`: Sensitivity to unfairness. Higher values mean the responder is more likely to reject unfair offers.

**5. Mapping to Observable Behavior:**

The utility will be passed through a logistic function to predict the probability of accepting the offer. A utility of 0 corresponds to 50% acceptance likelihood.

Here's the model specification:

<MODEL>
U = split_self - alpha * (split_self - combined_earning * (token_self / (token_self + token_opp)))
</MODEL>

<VARIABLES>
```json
