A utility model for responder behavior in a bargaining game. The utility of accepting an offer is the difference between the split for the responder and the model's calculation of unfairness, weighted by a single free parameter representing sensitivity to unfairness. This model assumes that the responder's perception of a fair split is proportional to their contribution during the token-finding phase.
</SUMMARY>

